import React from 'react';

const Ticket = ({ ticket }) => {
const { title, 
		ticketPrice, 
		date, 
		cinema, 
		crowdfundTarget, 
		totalsoFar, 
		tickets, 
		bookingTotal,
	} = ticket;

  return (
      <div className="film">

        <p>title</p>
      </div> 
    )
  }  

export default Ticket;
